pragma solidity ^0.5.0;

import "./zeppelin/Ownable.sol";

contract Customers is Ownable{

  struct Customer{
    string businessName;
    string contactPhone;
    uint createdAt;
    uint updatedAt;
  }

  Customer[] private customers;
  uint64[] public BussinessIdentifications;
  mapping ( uint64 => uint32 ) public customersIds;


  function registerCustomer(string memory _bussinessName, uint64 _bussinessId,
     string memory _contactPhone) public onlyOwner
  {
      uint  customerId = customersIds[_bussinessId];
      require (customerId == 0);

      Customer memory customer = Customer({
        businessName:_bussinessName,
        contactPhone:_contactPhone,
        createdAt: now,
        updatedAt: now
      });

      customers.push(customer);

      customersIds[_bussinessId] = uint32(customers.length);

      BussinessIdentifications.push(_bussinessId);

      emit newCustomerRegistered(_bussinessId,customer.businessName,customer.contactPhone,
      customer.createdAt,customer.updatedAt);

  }

  function totalCustomers() public view returns (uint)
  {
      return customers.length;
  }

  function getCustomerByBussinessId(uint64 _bussinessId) public view returns(uint64
    ,string memory, string memory, uint, uint)
  {
      uint32  customerId = customersIds[_bussinessId];
      require( (customerId > 0) || (customerId <= customers.length) );
      Customer memory customer = customers[customerId - 1];
      return(
        _bussinessId,
        customer.businessName,
        customer.contactPhone,
        customer.createdAt,
        customer.updatedAt
      );
  }

  function checkIfBussinessIdExist(uint64 _bussinessId)public view returns (uint32){
      return customersIds[_bussinessId];
  }


  event newCustomerRegistered(uint64 _bussinesid,  string _bussinesName,
     string _contactPhone, uint _createdAt, uint _updatedAt);


}
